interface UserInfo {
  userName: string;
  avatar: string;
  email: string;
  firstName: string;
  lastName: string;
}

const TOKEN_KEY = 'auth-token';

class UserManager {
  private static _instance: UserManager;
  private userName: string;
  private avatar: string;
  private email: string;
  private firstName: string;
  private lastName: string;

  private constructor() {
    this.userName = '';
    this.avatar =
      'data:image/png;base64,';
    this.email = '';
    this.firstName = '';
    this.lastName = '';
  }

  public getUserInfo() {
    const requestOptions = {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json',
        'auth-token': this.getToken()!,
      },
    };

    return new Promise((resolve, reject) => {
      const token = this.getToken();
      if (token) {
        fetch('/api/auth/userInfo', requestOptions).then((response) => {
          response.json().then((body) => {
            this.setUserData(body);
            resolve({
              userName: body.userName,
              avatar: body.avatar,
              firstName: body.firstName,
              lastName: body.lastName,
              email: body.email,
            });
          });
        });
      } else {
        reject('No token');
      }
    });
  }

  private setUserData(userData: UserInfo) {
    this.userName = userData.userName;
    this.firstName = userData.firstName;
    this.lastName = userData.lastName;
    this.email = userData.email;
  }

  public saveUserInfo(userInfo: UserInfo) {
    const requestOptions = {
      method: 'PATCH',
      headers: {
        'Content-Type': 'application/json',
        'auth-token': this.getToken()!,
      },
      body: JSON.stringify(userInfo),
    };

    return new Promise((resolve, reject) => {
      fetch('/api/auth/userInfo', requestOptions)
        .then((response) => {
          if (response.status === 400) {
            response.text().then((t) => {
              reject(t);
            });
          } else {
            response.json().then((j) => {
              resolve(j);
              this.setUserData(j);
            });
          }
        })
        .catch((err) => {
          reject(err);
        });
    });
  }

  public executeLogout() {
    window.localStorage.removeItem(TOKEN_KEY);
  }
  public executeLogin(userName: string, password: string) {
    const requestOptions = {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ userName, password }),
    };

    return new Promise((resolve, reject) => {
      fetch('/api/auth/login', requestOptions)
        .then((response) => {
          if (response.status === 200) {
            const token = response.headers.get('auth-token');
            if (token) {
              window.localStorage.setItem(TOKEN_KEY, token);
              resolve('Success');
            } else {
              reject('Token not found');
            }
          } else {
            response.text().then((t) => {
              reject(t);
            });
          }
        })
        .catch((err) => {
          reject(err);
        });
    });
  }

  public getToken() {
    return window.localStorage.getItem(TOKEN_KEY);
  }

  public isAuthenticated() {
    return this.getToken() ? true : false;
  }

  public fetchUserInfo() {
    return '';
  }
  public static get Instance() {
    if (!UserManager._instance) {
      UserManager._instance = new UserManager();
    }
    return UserManager._instance;
  }

  public registerUser(userData: any) {
    const requestOptions = {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(userData),
    };

    return new Promise((resolve, reject) => {
      fetch('/api/auth/register', requestOptions).then((response) => {
        if (response.status === 400) {
          response.text().then((t) => {
            reject(t);
          });
        } else {
          response.json().then((body) => {
            this.setUserData(body);
            this.executeLogin(userData.userName, userData.password).then(() => {
              resolve(body);
            });
          });
        }
      });
    });
  }
}

export default UserManager;
